import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { ToastrService } from 'ngx-toastr';

@Component({
  selector: 'app-return-request-page',
  templateUrl: './return-request-page.component.html',
  styleUrls: ['./return-request-page.component.css']
})
export class ReturnRequestPageComponent {
  constructor(private toastr:ToastrService,private route:Router){}
  onSubmit(){
    this.toastr.success("Return Initiated","Car Rental App")
    this.route.navigate(['/user-rental-agreements'])
  }



}
<h3 class="text-center mt-4">Return Request</h3>
<div class="d-flex justify-content-center align-items-center  mt-5">

    <form >
        <div class="form-group">
            <label for="">Comments:</label>

            <textarea autofocus cols="100" rows="3" class="form-control" required ></textarea>


        </div>
        <button class="btn btn-success mt-4">Confirm Return</button>

    </form>

</div>
